import React, { Component } from "react";
import perfume from "../images/image_perfume.png";
import test from"../images/image_one.png";
import pepper from"../images/image_three.png";
import shoes from"../images/image_four.png";
import computer from "../images/image_five.png";
import notsure from "../images/image_one.png";
import pizza from "../images/pizza_image.png";


import ("../pages/main.css");




class Main extends Component {
    render(){
        return(
            
            <div className="container">
            <div className="bg-image">
           
<div className="bg-image img1"><img src={perfume} alt="perfume" style={{}}/></div>
<div className="bg-image img2"><img src={pepper} alt="pepper"/></div>
<div className="bg-image img3"><img src={shoes} alt="shoes"/></div>
<div className="bg-image img4"><img src={computer} alt="computer"/></div>
<div className="bg-image img5"><img src={notsure} alt="bullshit"/></div>
<div className="bg-image img6"><img src={test} alt="bullshit"/></div>
<div className="bg-text">Snap It!</div>

</div>
            
            </div>
        )
    }
}

export default Main;
